import React, { Component, useState } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import LoginSite from "./Sitelayouts/login-site";
import DefaultSite from "./Sitelayouts/default-site";

export default function App() {
  const [loggedIn, setloggedIn] = useState("");

  function goToHome(event) {
    let value = "true";
    setloggedIn(value);
  }

  return (
    <Router>
      <script>
        if (loggedIn !== "true") {document.getElementById("goToLogin").click()}
      </script>
      <div>
        <Switch>
          <Route path="/">
            <DefaultSite />
          </Route>
          <Route path="/login">
            <LoginSite />
          </Route>
        </Switch>
      </div>
      <Link id="goToHome" className="d-none" to="/" onClick={goToHome}></Link>
      <Link id="goToLogin" className="d-none" to="/login"></Link>
    </Router>
  );
}
